import React, {Component} from 'react';

class DesignPage extends Component {
    render() {
        return (
            <div>
                <div className="container">
                    <p>
                        <span>
                            <strong>HomeGroup – Hàng đầu trong lĩnh vực thiết kế, sản xuất và thi công đồ Nội thất.</strong>
                        </span>
                        <p>Ngày nay việc thiết kế nội thất cho căn hộ của gia đình đã trở nên rất cần thiết, thiết kế nội thất để tạo không gian thoải mái, tiện nghi nhất cho người sử dụng cũng như hỗ trợ sức khỏe, sự an toàn, nâng cao chất lượng cuộc sống.&nbsp;HomeGroup là một trong những đơn vị chuyên nghiệp và uy tín trong việc thiết kế và thi công Nội thất.</p>
                    </p>
                </div>
            </div>
        );
    }
}

export default DesignPage;
